import React from "react";
import "./CardInfo.css";

export default function CardInfo({ header, text, link }) {
  return (
    <div className="extra-info inline-block">
      <h2 className="extra-info-header">{header}</h2>
      <p className="extra-info-text">{text}{link}</p>
    </div>
  );
}
